        {
            "type": "fragmentation",
            "attributes": {
                "eventType": "Anomalous",
                "epoch": "2006-02-14",
                "altitude": null,
                "comment": "This less severe debris-generating event apparently occurred on 14 February 2006, when a single fragment separated from the fifth oldest man-made object in Earth orbit, the Vanguard 3 spacecraft (International Designator 1959-007A, U.S. Satellite Number 20). Unlike Vanguards 1 and 2, which are also still in orbit about the Earth, Vanguard 3 remains attached to the small third stage of its launch vehicle. The combined mass of the spacecraft and stage is only 45 kg. The new piece of debris was cataloged in April 2006 (International Designator 1959-007B, U.S. Satellite Number 29005) in an orbit very similar to that of Vanguard 3, i.e., approximately 500 km by 3300 km with an inclination of 33.4°. The principal candidate causes for the release are (1) deterioration of the surface materials of Vanguard 3 or its orbital stage and (2) impact of the assembly by a very small meteoroid or orbital debris.",
                "latitude": null,
                "longitude": null
            },
            "id": "174",
            "relationships": {
