            }
        },
        {
            "type": "fragmentation",
            "attributes": {
                "eventType": "Anomalous",
                "epoch": "2006-08-08",
                "altitude": 685.0,
                "comment": "On 8 August the H-2A second stage (International Designator 2006-002B, U.S. Satellite Number 28932), which was used to place the Japanese ALOS-1 spacecraft into orbit in January, released four debris with very low relative velocities. At the time the stage was in an orbit of approximately 550 km by 700 km with an inclination of 98.2°. The debris immediately began to fall away from the stage due to their higher area-to-mass ratios. Then, on 27 August the stage released at least 17 more debris, again with low relative velocities. A total of 21 objects were officially cataloged by the SSN in early September. The status of the debris orbits at that time (Figure 1) indicated signifi cant orbital decay had already been experienced by many of the debris. Reentry of the debris into the atmosphere is expected in the near term; hence, no long-term effect on the space environment will result. The cause of these two events is currently under investigation",
                "latitude": "5.000000",
                "longitude": "131.000000"
            },
            "id": "175",
            "relationships": {
                "objects": {
                    "links": {
                        "self": "/api/fragmentations/175/relationships/objects",
                        "related": "/api/fragmentations/175/objects"
                    }
                }
            },
            "links": {
                "self": "/api/fragmentations/175"
            }
        },
        {
            "type": "fragmentation",
            "attributes": {
                "eventType": "Meteor Class",
                "epoch": "1999-05-01",
                "altitude": null,
                "comment": "Meteor 2-8 (1982-025A, U.S. Satellite Number 13113) was the first of a series of Soviet meteorological spacecraft to employ the Tsyklon (SL-14) launch vehicle and an operational orbit of approximately 950 km at an inclination of 82.5 degrees. The spacecraft, which apparently ceased functioning in the mid-1980s, experienced a minor perturbation in its orbit in May 1999. In January 2010, the SSN cataloged 40 debris (U.S. Satellite Numbers 36318-36357) associated with Meteor 2-8 and traced back to the date of the orbit change. At the time of the breakup, the spacecraft was in a nearly circular orbit with a mean altitude of 948 km. Whereas the orbit of Meteor 2-8 has declined only a few kilometers since 1999, the debris from the spacecraft, which possess higher drag characteristics, are now found in lower orbits, currently reaching from an altitude of 835 km to 945 km. The debris are all quite small with the largest exhibiting a radar crosssection of about 0.02 m2, roughly equivalent to 15 cm in diameter. Two other spacecraft in the Meteor 2 series have been linked to anomalous fragmentation events, including Meteor 2-17, for which 30 debris have been cataloged to date. Meteors 2-5, 2-6, and 2-7 have also released cataloged debris ranging from 8 to 19 in number. All of the Meteor 2 events have occurred many years after launch and are possibly due to a degradation of the vehicle itself.",
                "latitude": null,
                "longitude": null
            },
